//Map method
//https://jsonplaceholder.typicode.com/posts

import { useEffect, useState } from "react";


function App(){
    const [data,setData]=useState(null)
    useEffect(()=>{
        fetch("https://jsonplaceholder.typicode.com/posts")
        .then((res)=>{
            return res.json()
        })
        .then((res)=>{
            console.log(res)
            setData(res)
        })
    })
    return(
        <div>
            <h1>Fetch data from backend</h1>
             <table>
                <thead>
                    <tr>
                        <th>UserId</th>
                        <th>Id</th>
                        <th>Title</th>
                    </tr>
                </thead>
                <tbody>
                    <tr></tr>
                </tbody>
             </table>
        </div>
    )
}
export default App;
